(
    SPANHASH                 VARCHAR2(100) NOT NULL,
    INUMTARJETA              NUMBER(16)    NOT NULL,
    DSALDO                   NUMBER(18, 2) NOT NULL,
    STIPOTARIFA              VARCHAR2(100) NOT NULL,
    DTFECHAULTIMOABONO       DATE,
    DTFECHAULTIMAOPERACION   DATE,
    SALDO_MAYOR              NUMBER(1) NOT NULL,
    RECARGA_RECIENTE_15_DIAS NUMBER(1) NOT NULL,
  BENVIADA NUMBER(1) DEFAULT 0

)
;*/

--
