-- from ADMIN.ENVIAR_RECHAZADAS;

INSERT INTO ADMIN.ENVIAR_RECHAZADAS
SELECT t1.SPANHASH,
       t1.INUMTARJETA,
       t1.DSALDO,
       t1.STIPOTARIFA,
       t1.DTFECHAULTIMOABONO,
       t1.DTFECHAULTIMAOPERACION,
--       to_char(t1.DTFECHAULTIMOABONO, 'yyyy-mm-dd HH24:MI:SS')     DTFECHAULTIMOABONO,
--       to_char(t1.DTFECHAULTIMAOPERACION, 'yyyy-mm-dd HH24:MI:SS') DTFECHAULTIMAOPERACION,
       case when (t1.DSALDO > 100) then 1 else 0 end AS SALDO_MAYOR,
       case
           when (trunc(nvl(t1.DTFECHAULTIMOABONO, to_date('01-01-0001'))) < ((sysdate - 6 / 24) - 15)) then 0
           else 1 end                                AS RECARGA_RECIENTE_15_DIAS
